import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import React from 'react';

import './Body.css'

function Body() {
    return ( 
        <div className='body'>
            body

                <Routes>
                    <Route exact path="/" element={ <div>HOME</div> }/>
                    <Route exact path="/tab1" element={<div>TAB 1</div>}/>
                    <Route exact path="/tab2" element={<div>TAB 2</div>}/>
                    <Route exact path="/tab3" element={<div>TAB 3</div>}/>
                    <Route path="*" element={<div>NO SUCH THING</div>}/>
                </Routes>

        </div>
    );
}

export default Body;
